import React from "react";
import { Routes , Route } from "react-router-dom";
import CalculIMC from "./CalculIMC";
import Menu from "./menu";
import Historique from "./Historique";
import SaisirFilm from './SaisirFilm';
import AfficherFilms from './AfficherFilms';
export default function App(){
    return(
        <>
            <Menu/>
            <Routes>
                <Route path="/CalculIMC" element={<CalculIMC/>}/>
                <Route path="/Historique" element={<Historique/>}/>
                <Route path="/SaisirFilm" element={<SaisirFilm/>}/>
                <Route path="/AfficherFilms" element={<AfficherFilms/>}/>
                <Route path="/*"/>
            </Routes>
        </>
    )
}
